// n8n Code node (JavaScript)
// Get outputs from RecommendActions node
const out = $('ChatAgent').item.json.output || {};

// Get Manager object from Trigger node
const manager = ($('Trigger').first().json.data || {}).Manager || {
  name: "",
  address: "",
  user_id: "",
  person_number: "",
  Role: "Manager",
  Clients: [],
};

// Allowed statuses
const allowedDeal = ["create_new", "await_confirmation", "update", "unsupported_deal"];
const allowedInvoice = ["create_new", "await_confirmation", "update", "send_file_to_user"];

// Extract values
const deal = out.deal_next_step ?? null;
const invoice = out.invoice_next_step ?? null;

// Function to normalize into array
const toArray = (val) => Array.isArray(val) ? val : (val !== null ? [val] : []);

// Convey_to_user logic
let conveyToUser = false;
if (deal === null || invoice === null) {
  conveyToUser = true;
} else {
  const dealStatuses = toArray(deal);
  const invoiceStatuses = toArray(invoice);
  conveyToUser =
    dealStatuses.some(s => allowedDeal.includes(s)) ||
    invoiceStatuses.some(s => allowedInvoice.includes(s));
}

// Build response HTML (fallback if none provided)
const responseHtml = out.response_html ?? `
<div style="font-family:Arial,Helvetica,sans-serif;font-size:14px;line-height:1.5;color:#111;max-width:680px;">
  <p>Hi,</p>
  <p>No response content was generated.</p>
  <hr>
  <p>Best,<br>Patchbay Assistant</p>
</div>
`;

// tool_executed flag
const toolExecuted = Boolean(out.tool_executed);

// Final output
return [
  {
    output: {
      response: responseHtml,
      tool_executed: toolExecuted,
      deal_next_step: deal,
      invoice_next_step: invoice
    },
    convey_to_user: conveyToUser,
    Manager: manager,
  }
];

// Parse user_session for the current item
const userSessionString = $input.first().json.user_session;
const userSession = JSON.parse(userSessionString);

return {sub_session: userSession};
